import {Location} from '../@types/common';


interface Props {
    data: Location[]; // Location 타입의 배열을 받는 props
}

export default function GetLocation({ data }: Props) {
    return (
        <div className='w-full mt-8 flex_center'>
            {data.length > 0 && (
                <table className='w-full border'>
                    <thead>
                    <tr className='h-[60px] bg_base text-white'>
                        <th className='border-r'>코드</th>
                        <th className='border-r'>현장명</th>
                        <th className='border-r'>영업관할</th>
                        <th>장애접수</th>
                    </tr>
                    </thead>
                    <tbody>
                    {data.map((location, index) => (
                        <tr key={index} className='text-center h-[40px] border-b'>
                            <td>{location.PJTcode}</td>
                            <td>{location.pklName}</td>
                            <td>{location.sales_region}</td>
                            <td>{location.unyeong}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}
